{"1": {"comment_id": "nif.ientrec"  "comment_text": "National Innovation Foundation - India and NIF Incubation and Entrepreneurship Council - NIFientreC at Suvarna Palavi 2022 Mohotsava organised by Dr. Balasaheb Sawant Konkan Krishi Vidyapeeth  Dapoli from 13 to 17 May 2022 in Dapoli  Ratnagiri  Maharashtra!

Visit NIF's pavilion to learn more about grassroots innovations Mango Fruit Nipper and Orchard Sprayer.

#Orchard #Sprayer is an innovation by grassroots innovator Shri Rajendra Chhabulal Jadhav. The sprayer can be used to spray multiple crops like #grape  #mango  #sapota  #pomegranate  etc. covering the canopy at different heights. Honourable Prime Minister Shri Narendra Modi praised Shri Rajendra Jadhav in the 65th edition of ‘Mann Ki Baat’ for developing tractor-mounted sanitiser spraying machine  a variation of the orchard sprayer.

Mango Fruit Nipper is an innovation by grassroots innovator Shri Madhav Mahajan. The fruit nipper is a lightweight device that harvests mangoes without damage.

